la comparaison en Rust serait : ```Rust
struct Fibonacci {
    current: u64,
    next: u64,
}

impl Fibonacci {
    fn next(&mut self) -> Option<u64> {
        let new_next = self.current + self.next;

        self.current = self.next;
        self.next = new_next;

        return Some(self.next);
    }
}

fn main() {
    println!("init number: 1-1");
    move_thread();
}

fn move_thread() {
    let mut fibonacci = Fibonacci { current: 1, next: 1 };
    for index in 0..100 {
        match fibonacci.next() {
            Some(output) => println!("index: {0} number: {1}", index, output),
            None => println!("Error, can't get the next fibonacci's number"),
        }
    }
}
